INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (100, "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", 130011, 1, 2, 3001100, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3001, "ヤマト", 2.1, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (101, "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", 130011, 4, 2, 3001101, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3001, "ヤマト", 5.68, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (102, "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", 130011, 1, 1, 3001102, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3001, "ヤマト", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (100, "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", 130211, 1, 1, 3002100, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3002, "フブキ", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (101, "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", 130211, 1, 1, 3002101, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3002, "フブキ", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (102, "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", 130211, 5, 2, 3002102, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3002, "フブキ", 8.53, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (103, "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", 130211, 7, 1, 3002103, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3002, "フブキ", 5.67, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (104, "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", 130211, 1, 1, 3002104, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3002, "フブキ", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (300, "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", 130211, 3, 3, 3002300, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3004, "フブキ", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (301, "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", 130211, 7, 7, 3002400, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3005, "フブキ", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (200, "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", 130211, 2, 1, 3003200, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3003, "フブキ", 4.4, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (201, "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", 130211, 7, 7, 3003201, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3003, "フブキ", 0.0, -416.5);
INSERT INTO `v1_febbe3c75b33d091099a43fcc9fa5d951ce5fa36e4d8111262ab652b5ded8145` VALUES (202, "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", 130211, 1, 2, 3003202, "2024/10/31 12:00:00", 0.0, "2030/01/01 14:59:59", 3003, "フブキ", 5.6, -416.5);
